import React from 'react';
import PropTypes from 'prop-types';

const peopleILike = [
  {
    id: 1,
    name: "Kim",
    age: 6,
    rating: 5
  },
  {
    id: 2,
    name: "Lim",
    age: 7,
    rating: 4.8
  },
  {
    id: 3,
    name: "Lee",
    age: 9,
    rating: 5.5
  }
];

function Welcome({name, age, rating}) {
  return (
    <div>
      <h3>I like {name}</h3>
      <h4>{rating}/5.0</h4>
      <span>{age}</span>
    </div>
  );
}

Welcome.propTypes = {
  name: PropTypes.string.isRequired,
  age: PropTypes.number.isRequired,
  rating: PropTypes.number.isRequired
}

function App() {
  return (
    <div className="App">
      {peopleILike.map((obj) => 
        <Welcome key={obj.id} 
                 name={obj.name} 
                 age={obj.age}
                 rating={obj.rating}/>
      )}
    </div>
  );
}


export default App;
